import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { BusinessRouginRoutingModule } from './business-rougin-routing.module';
import { BusinessRouginComponent } from './business-rougin.component';


@NgModule({
  declarations: [
    BusinessRouginComponent
  ],
  imports: [
    CommonModule,
    BusinessRouginRoutingModule
  ]
})
export class BusinessRouginModule { }
